// Layout.js

import React from 'react';
import { Route, Switch } from 'react-router-dom';
import NavBar from './NavBar';

const Layout = ({ routes }) => {
    return (
        <div>
            <NavBar/>
            <Switch>
                {routes.map(route => (
                    <Route
                        key={route.path}
                        path={route.path}
                        exact={route.exact}
                        component={route.component}
                    />
                ))}
            </Switch>
        </div>
    );
};

export default Layout;
